// 新品上线设置的接口
import http from "./http";

//获取新品上线列表信息
const queryList = (pageNumber = 1, pageSize = 10, configType = 3) => {
    return http.get('/indexConfigs', {
        params: {
            pageNumber,
            pageSize
        }
    })
}

export default {
    queryList
}
